export default function Registration(props) {
  return (
    <>
      <AuthForm
        isRegistration={true}
        buttonText="Зарегистрироваться"
        legend="Регистрация"
        onAuthStatus={props.onAuthStatus}
        onTooltipOpen={props.onTooltipOpen}
      />
    </>
  );
}
